// //  If Time Service is configured to compute current time as TAI:
// STCF = new time - current MET 
// current time =  current MET + STCF 


//  If Time Service is configured to compute current time as UTC:
// STCF = ((new time) - (current MET)) + Leap Seconds

// var STCF = 1692219058 ;
// var current_MET = 2011;
// var newTime = ((current_MET) + STCF) - 32;


// UTC Time
var STCF = SecondsSTCF.value;
var newTime = STCF +  SecondsMET.value  - LeapSeconds.value;


// Convert to milliseconds
var newTime = newTime * 1000;
//print(newTime)
/* YAMCS code starts here. */
CFE_UTC_Time.value = newTime;

/* n = 1 polyFit coefficients from Octave */
/* Pressure */
/* ideal */
var slope = 469.6977821241700326;
var intercept = -1866.1763808587022595;

/* n = 5 polyFit coefficients from Octave */
/* Pressure */
/* ideal */
var a5 =    -0.0000942724708081;
var b5 =     0.0056360796672623;
var c5 =    -0.1275702156408666;
var d5 =     1.3529133693320812;
var e5 =   463.0708189194735951;
var f5 = -1854.4464100218297062;


function poly1Result(x)
{
    return slope * x + intercept;
}


function poly5Result(x)
{
    return a5 * x * x * x * x * x + b5 * x * x * x * x + c5 * x * x * x + d5 * x * x + e5 * x + f5;
}

function volts2Ma(x)
{
    return x * 10;
}

/* YAMCS code starts here. */
Pressure.value = poly5Result(volts2Ma(Pressure_Voltage.value));
Temperature.value = NaN;

/* Linear fit */
/* Alpha Beta */
/*
 *       -45    -30   -15   0     15    30    45
 * Alpha 1.11,  1.27, 1.43, 1.60, 1.79, 1.96, 2.12
 * Beta  2.046, 1.88, 1.73, 1.58, 1.42, 1.25, 1.08
 * 
 */

/* Alpha m and b. */
Am = 87.9981024667932;
Ab = -141.80265654649;

/* Beta m and b. */
Bm = -93.9479527460662;
Bb = 147.444601266898;


function linearFitAlpha(x)
{
    return ((Am * x) + Ab);
}

function linearFitBeta(x)
{
    return ((Bm * x) + Bb);
}

/* YAMCS code starts here. */
Alpha.value = linearFitAlpha(Alpha_Voltage.value);
Beta.value = linearFitBeta(Beta_Voltage.value);

if(usCmdCnt.value > 0){
    SassieState.value = true;
}
else{
    SassieState.value = false;
}

Position.values["Lat"] = Lat.value;
Position.values["Lon"] = Lon.value;
Position.values["Altitude"] = Altitude.value;

// The following is useful if we're getting position from a raw GPS source such as VN310_GPS_POSITION_MID
// Position.values["Lat"] = Lat.value / 10000000;
