// euler[1] = asinf(2.0f * (data[0] * data[2] - data[3] * data[1]));
// euler[2] = atan2f(2.0f * (data[0] * data[3] + data[1] * data[2]), 1.0f - 2.0f * (data[2] * data[2] + data[3] * data[3])

