Pitch.value = In_Pitch.value;

// Connvert heading of [-180, 180] to [-360,360]
Yaw.value = In_Yaw.value;
if(In_Yaw.value < 0) 
{
    Yaw.value = 360 + In_Yaw.value;
}
else
{
    Yaw.value = In_Yaw.value;
}

Roll.value = In_Roll.value;



